import { Text } from "domelementtype";
import { extend } from "lodash";
import React, { Component } from "react";
import Button from '@material-ui/core/Button';
import TextField from '@material-ui/core/TextField';

class Register extends Component{

    render (){

        return (
            <div>
                <form>
                <div>
                    <TextField id="mobile" label="Mobile Number" variant="outlined"/>
                </div>
                <div>
                    <TextField id="otp" label="OTP" variant="outlined"/>
                </div>
                <div>
                    <TextField id="password" label="Password" variant="outlined"/>
                </div>
                <div>
                    <Button variant="contained" color="primary" href="#contained-buttons">Submit</Button>
                </div>
                </form>
            </div>
        );
    }
}

export default Register;
